var JSONPAdapter=function(){this.initialize=function(e){url=typeof e!=="undefined"?e:"http://m.go2lighthouse.org";var t=$.Deferred();t.resolve();return t.promise()};this.eventsList=function(e){return $.ajax({url:url+"/services/getevents.php",dataType:"json"})};this.prayersList=function(e){return $.ajax({url:url+"/v2/services/getprayerrequests.php",dataType:"json"})};this.noticesList=function(e){return $.ajax({url:url+"/v2/services/getnotices.php",dataType:"json"})};this.findEventById=function(e){return $.ajax({url:url+"/services/getevent.php?id="+e,dataType:"json"})};this.findPrayerById=function(e){return $.ajax({url:url+"/v2/services/getprayer.php?id="+e,dataType:"json"})};this.findNoticeById=function(e){return $.ajax({url:url+"/v2/services/getnotice.php?id="+e,dataType:"json"})}}